class TransmissionConfig {
  /**
   * @param boolean online if true send data online, or batch otherwise
   * @param string endPoint EndPoint URL
   * @param string user Endpoint User
   * @param string password EndPoint Password
   * @param number maxRetries number of retries in case of record sending failure
   * @param number delayBetweenRetries time in milisegundos between record sending retries
   */
  constructor(online, endPoint, user, password, maxRetries, delayBetweenRetries, errorReporter) {
    const args = Array.from(arguments);
    if (online && (args.lenngth < 7 || args.some((arg) => arg === undefined || arg === null))) {
      errorReporter('ERROR_MISSING_ARGUMENTS');
    }
    this.online = online;
    this.endPoint = endPoint;
    this.user = user;
    this.password = password;
    this.maxRetries = maxRetries;
    this.delayBetweenRetries = delayBetweenRetries;
  }
}

/**
 * @returns {TransmissionConfig}
 */
export default TransmissionConfig;
